import React from "react";

const Icon = ({ user }) => {
  switch (user) {
    case "Urgent":
      return <img src="./urgent.svg" alt="Urgent Icon" />;
    case "High":
      return <img src="./High.svg" alt="High Icon" />;
    case "Medium":
      return <img src="./Medium.svg" alt="Medium Icon" />;
    case "Low":
      return <img src="./Low.svg" alt="Low Icon" />;
    case "No priority":
      return <img src="./Nopriority.svg" alt="No Priority Icon" />;
    case "Todo":
    return <img src="./Todo.svg" alt="No Priority Icon" />;
    case "Backlog":
    return <img src="./Backlog.svg" alt="No Priority Icon" />;
    case "In progress":
    return <img src="./Inprogress.svg" alt="No Priority Icon" />;

    default:
      return <img src="./Backlog.svg" alt="âœª" />; // Handle the case where no icon matches
  }
};

export default Icon;
